    "Summary": "<p>Las semillas de Cannabis Y griega CBD 2.0 del banco Medical Seeds® es una cepa de marihuana hibrida 50% / 50% con bajos niveles de THC y altos niveles de CBD. Tras años de trabajos de selección y cruces con nuestra Y Griega CBD, hemos logrado una planta con muy alto contenido de CBD y un THC por debajo del 0,3 %.</p>",
    "Description": "<p>Las semillas de Cannabis del banco Medical Seeds® <strong>es una cepa de marihuana hibrida 50% / 50% con bajos niveles de THC y altos niveles de CBD.</strong></p><p>Tras años de trabajos de selección y cruces con nuestra Y Griega CBD, hemos logrado una planta con muy alto contenido de CBD y un THC por debajo del 0,3 %. Gracias a los cruces con la famosa genética Cherry Wine CBD hemos conseguido que toda la descendencia tenga esta característica. Esto la hace una planta ideal para todos aquellos usuarios que quieran usarla como coadyuvante a algún tratamiento terapéutico.</p><p>Debido a sus bajos niveles de THC es apta para todo tipo de personas, incluyendo personas mayores y personas que no tienen tolerancia previa o nunca han tenido contacto con ella. El efecto psicoactivo que tiene es prácticamente nulo por lo que la hace perfecta para consumirla por vía oral, ya sea mediante tinturas, mantequilla, aceites vegetales, etc. A nivel estructural, es parecida a la Y Griega CBD, aunque mejora su producción a nivel general, tanto de flores como de resina. A nivel de aroma y sabor, sigue teniendo una clara predominancia cítrica, pero esta vez con pequeños matices a vino dulce, acerezado.</p><p> Para conseguir su máximo rendimiento organoléptico, recomendamos cultivarla con productos orgánicos.planta es el resultado de nuestra colaboración con CBD Crew. Fruto del cruce de nuestra madre Y Griega cruzada por una planta con un alto contenido en CBD y muy poco THC, hemos conseguido la siguiente estabilización para darle a la planta el ratio 1:1 (THC:CBD). Los niveles pueden variar desde un 4 a un 10, siempre con el ratio 1:1 presente. Y CBD es una planta indicada para aquellas personas que no quieran o no toleren los altos niveles de THC.</p><p> Muy indicado para hacer cremas, tinturas y demás consumibles terapéuticos, por su moderado efecto psicoactivo. Para información más detallada de todos los usos medicinales consultar nuestra pagina web. Morfológicamente es una planta de porte robusto con hoja ancha y de crecimiento vigoroso. No recomendamos poner más de 16 plantas por m2. En interior Y Griega CBD es muy vigorosa y necesita un crecimiento corto. En exterior la altura de las plantas de Y Griega CBD alcanza los tres metros, se cosechan a finales del mes de octubre y tienen una buena producción.</p><p> Prefiere los nutrientes orgánicos frente a los minerales y mejora no solo en sabor y aroma sino también en rendimiento. Su sabor y aroma es entre acido y almizclado con toques alimonados. En resumen Y CBD está especialmente recomendada para aquellos que no busquen un colocón extremo ya que el efecto es de relajación corporal mas que mental. Para los que quieran hacer cremas o tinturas y para todos los amantes del CBD en general.</p><h4>FICHA TÉCNICA</h4><p><ul><li>50% Indica 50% Sativa</li><li>Período vegetativo en interior: 3-4 semanas</li><li>Período floración en interior: 9-10 semanas</li><li>Producción en interior/m2: 450 gr</li><li>Altura en exterior: 2 metros  </li><li>Producción en exterior/planta: +600 gr</li><li>Genotipo: Y Griega CBD x Cherry Wine CBD</li><li>THC: bajo</li><li>CBD: alto</li></ul></p>",
