    "Summary": "<p>El Balastro magnético 600 W Vanguard aumenta el rendimiento lumínico. Fabricados mediante un diseño estudiado, con materiales de la más alta calidad.</p>",
    "Description": "<p>El Balastro magnético 600 W Vanguard aumenta el rendimiento lumínico. <strong>Fabricados mediante un diseño estudiado, con materiales de la más alta calidad.</strong></p><p>En cuanto a calidad se refiere Vanguard es una de las marcas más reconocidas en el sector del cannabis de interior. El balastro electrónico Vanguard es la imagen de que la buena calidad y el buen precio no deben ser dos conceptos reñidos.</p><p>Vanguard pone al alcance de todos aparatos eléctricos de gran calidad, pero asequibles para que cualquiera pueda hacer uso de ellos y conseguir un cultivo que además de ser de calidad, sea seguro, algo indispensable.</p><p>Características del balastro magnético 600 W Vanguard. Este balastro es totalmente cerrado, para una mayor seguridad en el cultivo, protegiendo las conexiones y el cableado con una caja plástica.</p><p>En caso de que tengamos que ponerlo colgado, incluye un gancho en la parte posterior para que se quede bien sujeto.</p><p>El cable que va hacia la luz es de 1.6 metros aproximadamente, tamaño más que suficiente en la mayor parte de habitaciones aunque siempre puedes utilizar una alargador.</p><p>El encendido de las bombillas lo realiza sin parpadeos y de manera instantánea ofreciendo una luz más estable y además más cómoda para las plantas.</p><p>Gracias a su diseño se disipa el calor que desprende la bobina interior, aunque el balastro desprende calor por lo que lo mejor que podemos hacer es no tocarlo por seguridad para no quemarnos.</p><p>Encienden las ampolletas sin parpadeos, otorga una luz estable y confortable para las plantas.</p><p>Seguridad en conexiones (Plug & Play)  Las conexiones del balastro magnético 600 W Vanguard ya vienen realizadas, simplemente tendrás que conectar uno de los cables al reflector y el otro irá a la luz.</p><p>Al tener las conexiones ya realizadas de fábrica y además estar totalmente cerrado, nos ahorrará tiempo y nos asegurará que todo está correctamente conectado eliminando así el riesgo de incendio por cortocircuito.</p><p>Compatibilidad de Ampolletas  Este balastro magnético 600 W Vanguard es compatible con las ampolletas de Haluro y las de Sodio siempre y cuando la ampolleta sea de la misma potencia que el balastro, en este caso 600w.</p>",
