    "Description": "Siempre listo para limpiar el bong, pipa, vaporizador o herramientas de los residuos de resina y la combustión del cannabis. Por lo que traemos este poderoso líquido limpiador con tecnología bio-degradable capaz de eliminar hasta el 99% de residuos en 1 minuto. DabCleaner es una solución definitiva que remueve impurezas y residuos adheridos a nuestras herramientas o accesorios para fumar flores o concentrados, fórmula diseñada para eliminar el 99% de residuos adheridos al VIDRIO, CERÁMICA, METAL y SILICONA.</p><p>Cuando se trata de disfrutar el sabor del cannabis, es muy importante usar instrumentos limpios, ¡Los terpenos no se sienten cuando el bong esta sucio! a más limpieza…. más terpenos.</p><p>FORMATO: 250cc</p><p>INSTRUCCIONES DE USO   Vierta una pequeña cantidad de Super Dab Cleaner en el bong sin agua.  El líquido debe tener contacto con los rincones mas sucios.  Dejar reposar 1 minuto.  Mover enérgicamente (shake shake).  Eliminar el contenido.  Lavar con lavalozas y abundante agua tibia.  RECOMENDACIONES   Se recomienda usar guantes de silicona o latex, en caso de contacto con la piel, lavar con agua y jabón  Tapar los dos orificios del bong antes de agitar enérgicamente   Si el bong esta muy sucio, se recomienda dejar reposar por mas tiempo el líquido en los rincones mas difíciles  Repetir el proceso de ser necesario  PRECAUCIONES  Líquido inflamable , no dejar al alcance de los niños o animales, en caso de contacto con los ojos, lavar con abundante agua por 15 minutos, en caso de ingestion accidental, no inducir al vomito, no contiene destilados de petróleo.",
